import React from "react";
import Navbar from "./Navbar";
import HomePage from "./HomePage";
import Login from "./Login";
import Register from "./Register";
import PostList from "./PostList";






function App() {
  return (
    <div>
      <Navbar />

      <div id="home">
        <HomePage />
      </div>

      <div id="login" style={{ scrollMarginTop: "80px" }}>
        <Login />
      </div>

      <div id="register" style={{ scrollMarginTop: "80px" }}>
        <Register />
      </div>

      <div id="posts" style={{ scrollMarginTop: "80px" }}>
        <PostList />
      </div>
    </div>
  );
}

export default App;
